import React from "react";
const CampaignCardItem = (props) => {
  return (
    <li className="card-item">
      <figure>
        <blockquote>
          <p>{props.ngo}</p>
        </blockquote>
        <blockquote>
          <p>{props.objective}</p>
        </blockquote>
        <blockquote>
          <p>{props.minimum}</p>
        </blockquote>
        <blockquote>
          <p>{props.target}</p>
        </blockquote>
        <blockquote>
          <p>{props.wallet}</p>
        </blockquote>
        <blockquote>
          <p>{props.email}</p>
        </blockquote>
        <blockquote>
          <p>{props.phone}</p>
        </blockquote>
      </figure>
      
    </li>
  );
};

export default CampaignCardItem;
